import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";
import Component from "./Component";
import Components from "./Components"; 

function App() {
  return (
    <div className="app-div">
      <Navbar />

      <h2>Categoreies to cart</h2>

      <Component />

      <Components />

      <div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
